import React, { useEffect, useState } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import axios from 'axios'
//import styles from '../styles.css'

const Blog = () => {
  const dispatch = useDispatch()
  var counter = ''
  var error = ''

  useEffect(() => {
    axios
      .get('https://ws.med.tn/web/doctorInfos/?api_key=drmateri')
      .then(response => {
        console.log('state.response', response)
        dispatch({
          type: 'SET_POSTS',
          payload: Object.values(response)[0],
        })
      })
      .catch(error => {
        console.log('state.response', error)
        dispatch({ type: 'SET_ERROR', payload: error })
      })
  }, [])
  useSelector(state =>
    state && state.posts != undefined
      ? (counter = state.posts)
      : state && (error = state.error)
  )

  console.log('state.errr', error)
  console.log('state.counter', counter)

  return counter ? (
    <div className="containerGlobal">
      <div className="container">
        <div className="carte">
          <div className="img">
            {counter && counter[0].photos[4] != undefined ? (
              <img src={counter[0].photos[4]} className="App-logo" alt="logo" />
            ) : null}
          </div>
          <div className="name">
            {counter && counter[0].firstname != undefined ? (
              <h4>
                {counter[0].type.title +
                  ' ' +
                  counter[0].firstname +
                  ' ' +
                  counter[0].lastname}
              </h4>
            ) : null}
            {counter && counter[0].speciality != undefined ? (
              <h6> {counter[0].speciality.title}</h6>
            ) : null}
            <div className="arrow">
              <i className="material-icons">keyboard_arrow_down</i>
              <i className="material-icons">expand_more</i>
            </div>
          </div>
        </div>
        <div className="information">
          <div className="informationDoctor">
            <div className="presentation">
              {counter && counter[0].speciality != undefined ? (
                <span>
                  <p>
                    {' '}
                    <h1>About the Doctor </h1>
                    {counter[0].diploma}
                  </p>

                  <button className="button1">Read More</button>
                  <button className="button2">Export Service</button>
                </span>
              ) : null}
            </div>
            <div className="Appointment">vxvxwvc</div>
            <div>Appointment Schedule.</div>
            <div></div>
            <div></div>
            <div className="cartdoc">xcvxvx</div>
          </div>
        </div>
      </div>
    </div>
  ) : (
    error != undefined && <p>Something went wrong </p>
  )
}

export default Blog
